import React from "react";
import "./contact.css"
import swt from './swt.jpg';

const Contact =() =>{
    return (
        <>
        <div className="contactMain">
        <div className="subcon">
        <img className="pos" src={swt}  alt="swt" />
        </div>
        <div className="tage">
        <h1 >Contact Us</h1>
        </div>
       
        </div>
        </>
    );
}
export default Contact;
